fn print_helper_low_and_high<let N: u32, T>(name: str<N>, low: T, high: T) {
    std::print(name);
    std::print(" = { low = \"");
    std::print(low);
    std::print("\", high = \"");
    std::print(high);
    std::println("\" }");
}


