    let receiver_2_public_point = std::embedded_curve_ops::fixed_base_scalar_mul(receiver_2_private_key);
    let receiver_2_public_hash = poseidon::bn254::hash_2([receiver_2_public_point.x, receiver_2_public_point.y]);

